import React from 'react';

import {StyleSheet, css} from 'aphrodite';
// import './index.css';

import shiro from './images/shiro.png';
import akame from './images/akame.png';

export default class Menu extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div className={css(style.container)}>
                <div className={css(style.titleContainer)}>
                    <h1 className={css(style.titleText, style.titleGradient)}>React Sandbox</h1>
                </div>
                <div>
                    <img src={shiro} alt='shiro' className={css(style.titleImage)}/>
                    {/* <div class='shadow'></div> */}
                </div>
                <h1 className={css(style.titleText, style.titleGradient)}>-</h1>
                <div className={css(style.buttonContainer)}>
                    <button className={css(style.buttonElement)} onClick={() => this.props.handleDisplayChange(1)}>
                        <img src={akame} className={css(style.buttonImage)}/>
                        <h1>MxJ</h1>
                    </button>
                    <button className={css(style.buttonElement)} onClick={() => this.props.handleDisplayChange(1)}>
                        <img/>
                        <h1>MxJ</h1>
                    </button>
                    <button className={css(style.buttonElement)} onClick={() => this.props.handleDisplayChange(1)}>
                        <img/>
                        <h1>MxJ</h1>
                    </button>
                </div>
            </div>
        )
    }
}

const style = StyleSheet.create({
    container: {
        backgroundColor: "#E7CFEA",
        position: 'relative'
    },

    titleContainer:{
        width:700,
        height:'fit-content',
        margin:'auto',
        paddingTop:100
    },

    titleText:{
        fontSize: 120,
        textAlign: 'center',
        margin:'auto',
    },

    titleGradient:{
        backgroundImage: 'linear-gradient(45deg, #efe633, #998CD9)',
        backgroundClip: 'text',
        color:'rgba(0,0,0,0)',

        zIndex: 3
    },

    titleImage:{
        width: '800px',
        height: '800px',
        
        display: 'block',

        margin:'auto',
        paddingTop:200,
        paddingBottom:300
    },

    buttonContainer:{
        width:800,
        height:'fit-content',
        paddingTop:30,
        paddingBottom:30,
        margin:'auto',
        marginTop:120,
        borderRadius:150,

        display: 'grid',
        gridTemplateColumns: 'auto',

        backgroundColor: '#D1A6D8'
    },

    buttonElement:{
        width:600,
        height:150,

        margin:'auto',
        marginTop:20,
        marginBottom:20,

        display:'flex-box',
        justifyContent:'center',

        borderRadius:50
    },

    buttonImage:{
        width:50
    }
})
